chase, you will receive your files by email, at the address given at payment. please check your junk mail as needed. it is also possible to download your files by connecting to your freelogodesign account.\"},\"reccuringOrOneTime\":{\"q\":\"Is my plan a one-time or recurring charge?\",\"a\":\"To better meet your needs, freelogodesign offers both options; it is possible to choose a single-fee plan or a subscription.\\nMost of our customers opt for the Privilege subscription for peace of mind. Indeed, you will be able to create as many logos as you want (with unlimited changes), accompanied by all the brand visuals included (business cards, brand guide, email signature, social networks...)\"},\"editAfterDownload\":{\"q\":\"Can I edit my logo after downloading it?\",\"a\":\"Depending on the plan chosen, it is possible to make changes to your logo. However, please note that the possibilities vary depending on the plan chosen:\\nIf you have chosen the business plan, you have 7 days to make minor changes to your logo. you will be able to change the text, font, and colors; however, it will not be possible to change the icon or shape.\\nIf you have chosen the premium plan, there is no time limit for making minor changes to your logo. you will be able to change the text, font, and colors; however, it will not be possible to change the icon or shape.\\nIf you chose the unlimited plan, there is no time limit for making changes to your logo. It is also possible to change all elements of your logo.\\nIf you chose the Privilege plan, you can create as many logos as you want with all of your brand elements included.\"},\"updateLogo\":{\"q\":\"Can I update my logo?\",\"a\":\"Yes it is possible. Log in to your freelogodesign account to make changes to your logo. please note, however, that depending on the plan you choose there may be a time limit or an action limit. for example, only the unlimited plan allows you to change all elements of your logo without time limits.\"},\"ownLogo\
